akaas in poedervorm 7% (waarvan 6% gedroogde mozzarella melk , smeltzouten: natriumcitraten, melkserumpoeder (melk)), melkserumpoeder melk , econcentreerde boter (melk), tarwezetmeel, maniokzetmeel, glucosestroop, aromals evat melk), gerstemoutextract, zout, bereiding van gedroogd spek 0.6% (spek varkensvlees, bewaarmiddelen: natriumnitraat, natriumnitriet, natriumascorbaat), rookaroma, antioxidant: rozemari)nextract), emulgator: lecithinen (koolzaad), voedingszuur: citroenzuur, kleurstoffen: paprika-extract, carotendiden. Kan sporen bevatten van schaalvruchten, vis, selderij, eieren en soja. OM DE VAN ONZE KOEKJES OPTIMAAL TE HOUDENI BINNEN 7 DAGEN OPENING CONSUMEREN EN BIJ VOORKEUR BEWAREN IN EEN HERMETISCH AFSLUITBAAR DAT GESCHIKT ts V00R CONTACT MET VOEDINGSMIDDELEN. @ PENSEZAUTRI ! ENSEMBLE RÉDUISONS DES ENULUGES', 'https://static.openfoodfacts.org/images/products/310/613/004/0989/front_fr.6.400.jpg', '37', '17', '46', '20', '', '10', '1.81', '0.71259842519685', '', '0');

