VALUES ('3108440037802', 'Café Gringo', 'Depuis toujours Jacques Vabre est de café, ce produit de caractère, presque tant il est animé d\'arômes, d\'évocati&gt; Grâce à son talent et à son expertise Jacques Vabre crée des cafés aux goûts varis qui vont mettre vos sens en En mariant avec soin des grains de grande qualité, Jacques Vabre a conçu un café vraiment équilibré : un café bien afirmé intense sans être corsé, avec ce qutl d\'amertume mais sans âpreté. Un café fin tout en étant marqué. Conseils de préparation Lorsque le torréfacteur réalise un mélange, il assemble les meilleurs grains, déguste de nombreux cafés pour parvenir à force de paticncc et d\'imagination Qu mariage • le plus harmonieux possble. Pour retrouver tout cet arômeìt cette saveur, versez une cuilliére à café dans votre tasse, puis ajouter de l\'eau frémissante mais non bouillante.', 'https://static.openfoodfacts.org/images/products/310/844/003/7802/front_fr.3.400.jpg', '15', '7', '8', '2', '', '9', '3', '1.18110236220472', '', '0');

