VALUES ('3110671103812', 'Cake aux Raisins Secs et aux Fruits Confits', 'Fruits (raisins secs 13.8%, fruits confits 10.2% : pastèques confites (pastèques, sirop de glucose-fructose, sucre, conservateurs : sorbate de potassium - _anhydride sulfureux_, colorants : carmin, correcteur d\'acidité : acide citrique), bigarreaux confits (bigarreaux, sucre, conservateurs : sorbate de potassium - _anhydride sulfureux_, colorant : carmins, correcteur d\'acidité : acide citrique), écorces d\'oranges confits (écorces d\'oranges, sirop de glucose-fructose, sucre, conservateurs : sorbate de potassium - _anhydride sulfureux_, correcteur d\'acidité : acide citrique)), farine de _blé_, sucre, huile de colza, sirop de glucose-fructose, _œufs_ frais 10%, stabilisant : glycérol, arômes, sel, poudres à lever : diphosphates - carbonates de sodium - carbonates d\'ammonium, _lait_ écrémé en poudre, acidifiants : acide tartrique - acide citrique, épaississant : gomme cellulosique, amidon de _blé_.', 'https://static.openfoodfacts.org/images/products/311/067/110/3812/front_fr.5.400.jpg', '15', '1.5', '61', '37', '0', '4.4', '0.57', '0.224409448818898', '', '0');

